import React from "react";
import Modal from "@mui/material/Modal";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";

const Modelpokemon = ({ open, handleClose, data }) => {
  return (
    <Modal
      open={open}
      onClose={handleClose}
      aria-labelledby="modal-modal-title"
      aria-describedby="modal-modal-description"
    >
      <Box sx={{ position: "absolute", top: "50%", left: "50%", transform: "translate(-50%, -50%)", width: 400, bgcolor: "background.paper", border: "2px solid #000", p: 2 }}>
        <Typography id="modal-modal-title" variant="h6" component="h2">
          {data.name}
        </Typography>
        <img src={`https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/other/dream-world/${data.id}.svg`} alt="" />
        <div className="abilities">
          {data.abilities.map((poke, index) => (
            <div key={index} className="group">
              <h2>{poke.ability.name}</h2>
            </div>
          ))}
        </div>
        <div className="base-stat">
          {data.stats.map((poke, index) => (
            <div key={index}>
              <h3>{poke.stat.name}:{poke.base_stat}</h3>
            </div>
          ))}
        </div>
        <Button onClick={handleClose}>Close</Button>
      </Box>
    </Modal>
  );
};

export default Modelpokemon;
